import React from 'react';
import Button from '@material-ui/core/Button';

const Event = () => {
    return (
        <React.Fragment>
            <Button size="medium" color="primary" variant="contained" style={{textTransform:'none'}}>
                Add new Event
            </Button>
        </React.Fragment>
    )
}
export default Event;
